import React, { useState } from 'react';
import api from './services/api';
import './App.css';

import logo from './assets/logo.svg'

import Routes from './routes'

function App() {

  return (
    <div className="container">
      <img src={logo} alt="AirCnC" />
      <div className="content">
        <Routes />
      </div>
    </div>
  );
}

export default App;
